import React, { Component } from 'react';
import '../../SCSS/nav.scss'
import ngeLogo from '../Images/nge.png'
class nav extends Component {

    constructor(props){
        super(props)
        this.username = this.props.username
        this.imageFile = this.props.imageFile

    }

    componentDidMount(){
        alert(this.username)

    }



    render() {
        return (
            <div id="navContainer">
                <img src={this.props.imageFile} id="ngeLogo" />
            </div>
        );
    }
}

export default nav;
